import{_ as i,o as a,c as l,e}from"./chunks/framework.nzJD8CNM.js";const t="/assets/enter.dkAKCFyR.jpg",r="/assets/wall.yHS9A1JO.jpg",o="/assets/price.vcNh2eao.jpg",f=JSON.parse('{"title":"Древрика","description":"Открытая столярная мастерская","frontmatter":{"title":"Древрика","date":"2019-09-29","cover":"cover.jpg","icon":"logo.png","description":"Открытая столярная мастерская","city":"г. Владивосток","address":"Океанский проспект, 66","place":"Фрунзенский район","url":"https://drevrika.ru","email":"drevrika.ws.office@gmail.com","instagram":"open_drevrika","telegram":"Open_drevrika","tel":"+7 (902) 524-03-16","coord":[43.131009895174245,131.89502116929847],"status":"open","hours":"СР-СБ 10:00-19:00, \\nВС 10:00-17:00, \\nПН-ВТ – выходные дни\\n","youtube":"https://youtu.be/IJ5THbSXtYw"},"headers":[],"relativePath":"workshop/catalog/drevrika/index.md","filePath":"workshop/catalog/drevrika/index.md"}'),s={name:"workshop/catalog/drevrika/index.md"},p=e('<p>Открытая столярная мастерская «Древрика» — место для тех, кто:</p><ul><li>без ума от запаха дерева;</li><li>желает найти себя в столярном деле;</li><li>гадает, где и чем воплотить свою идею в жизнь;</li><li>ищет, где обучить ребёнка полезным навыкам ручной работы;</li><li>любит узнавать и пробовать новое.</li></ul><p>Это доброе место с уютной атмосферой и морем инструментов, куда можно прийти, чтобы вдоволь напилиться, насверлиться, да и сколотить что-нибудь полезное. Опытные и обаятельные мастера вам в этом помогут.</p><p><img src="'+t+'" alt=""></p><h3 id="то-место-где-вы-можете" tabindex="-1">То место, где вы можете: <a class="header-anchor" href="#то-место-где-вы-можете" aria-label="Permalink to &quot;То место, где вы можете:&quot;">​</a></h3><p>Наслаждаться запахом дерева, витающего в творческой атмосфере 2. Шуметь и пылить без звона в батареях и жалоб соседей 3. Использовать любой доступный инструмент для воплощения своей идеи 4. Найти себя в столярном деле и других промыслах 5. Вырастить из сына умелого мужчину.</p><p><img src="'+r+'" alt=""></p><p>Мы инструктируем каждого гостя и строго следим за соблюдением техники безопасности, учим работать с инструментами и помогаем воплотить идею в жизнь. Шкатулка, фотофон, журнальный столик, табурет и даже шкаф - всё это и многое другое осуществимо в нашей мастерской. Также вы можете отреставрировать и вдохнуть новую жизнь в старые предметы мебели и интерьера.</p><h3 id="c-кем-вы-будете-творить" tabindex="-1">C кем вы будете творить <a class="header-anchor" href="#c-кем-вы-будете-творить" aria-label="Permalink to &quot;C кем вы будете творить&quot;">​</a></h3><p>За плечами наших мастеров-преподавателей множество смелых проектов, эффектных работ, радостных учеников и новичков-практиков. Нам в радость делиться с вами личным опытом и хитростями в современном столярном мастерстве. Мы делаем упор на дизайн и решение технических задач в творчестве, нежели на углубление в столярное дело «по-дедовски», так как время поменялось и нужны более актуальные знания для воплощения идей. С нами вы в надёжных руках и в приятной компании ; -)</p><h3 id="электроинструменты-и-станки" tabindex="-1">Электроинструменты и станки: <a class="header-anchor" href="#электроинструменты-и-станки" aria-label="Permalink to &quot;Электроинструменты и станки:&quot;">​</a></h3><ul><li>Распиловочный циркулярный станок Makita 2704</li><li>Торцовочная пила Metabo KS216M</li><li>Токарный станок Jet</li><li>Лобзиковый станок</li><li>Шлифовальный станок Энкор Корвет</li><li>Электролобзики</li><li>Фрезер 2 кВт</li><li>Фуганок-электрорубанок Makita (до 110 мм)</li><li>Шлифовальный станок Энкор Корвет-51</li><li>Погружная пила</li><li>Шуруповерты аккумуляторные</li><li>Шуруповерт сетевой</li><li>Дрели сетевые</li><li>Перфоратор (ну а вдруг)</li><li>УШМ (турбинки, болгарки)</li><li>Шлифмашинки эксцентриковые (орбитальные)</li><li>Шлифмашинка вибрационная</li><li>Компрессор Metabo 24 л</li><li>Паяльники</li></ul><p>По ходу работы регулярно пополняем нашу коллекцию шуруповертами, дрелями и множеством ручных инструментов.</p><p><img src="'+o+'" alt=""></p>',14),c=[p];function n(d,_,h,m,u,k){return a(),l("div",null,c)}const v=i(s,[["render",n]]);export{f as __pageData,v as default};
